import{_ as l,Q as i,S as e,a5 as a}from"./framework-ec2af7a3.js";const n={},r=a('<h1 id="数据结构与算法" tabindex="-1"><a class="header-anchor" href="#数据结构与算法" aria-hidden="true">#</a> 数据结构与算法</h1><h2 id="什么是算法" tabindex="-1"><a class="header-anchor" href="#什么是算法" aria-hidden="true">#</a> 什么是算法？</h2><p>算法是对特定问题求解步骤的一种描述，它是指令的优先序列，其中每一条指令表示一个或多个操作，此外，一个算法还有以下五个重要特性：</p><ul><li>有穷性</li><li>确定性</li><li>可行性</li><li>输入</li><li>输出</li></ul><p><strong>一个好的算法应该具有：</strong></p><ul><li>正确性</li><li>健壮性</li><li>可读性</li><li>效率与地存储量需求</li></ul><p><strong>算法效率的度量：</strong></p><ul><li>事后统计的方法</li><li>事前分析估算的方法</li></ul><p><strong>高级语言所消耗的时间取决于：</strong></p><ul><li>依据的算法采用何种策略</li><li>问题的规模</li><li>书写程序的语言</li><li>编译程序所产生的机器代码的质量</li><li>机器指令运行的速度</li></ul><p><strong>相关名词：</strong></p><ul><li>时间复杂度</li><li>频度：语句重复执行的次数</li><li>空间复杂度</li><li>常用的时间复杂度所耗费的时间从小到大依次是：<code>O(1) &lt; O(logn) &lt; O(n) &lt; O(nlogn) &lt; O(n^2) &lt; O(n^3) &lt; O(2^n) &lt; O(n!) &lt; O(n^n)</code></li></ul><br><h2 id="八大数据结构" tabindex="-1"><a class="header-anchor" href="#八大数据结构" aria-hidden="true">#</a> 八大数据结构</h2><ul><li>数组（Array）</li><li>链表（LinkedList）</li><li>队列（Queue）</li><li>栈（Stack）</li><li>堆（Heap）</li><li>散列表（Hash）</li><li>树（Tree）</li><li>图（Graph）</li></ul><br><h2 id="八大常用算法思想" tabindex="-1"><a class="header-anchor" href="#八大常用算法思想" aria-hidden="true">#</a> 八大常用算法思想</h2><ul><li>枚举/穷举</li><li>递推</li><li>递归</li><li>分治</li><li>动态规划</li><li>贪心算法</li><li>回溯算法</li><li>模拟算法</li></ul>',18),t=[r];function d(s,h){return i(),e("div",null,t)}const c=l(n,[["render",d],["__file","index.html.vue"]]);export{c as default};
